// SPDX-License-Identifier: MIT
pragma solidity ^0.8.26;

interface IERC20 {
    function transferFrom(address sender, address recipient, uint256 amount) external returns (bool);
    function transfer(address recipient, uint256 amount) external returns (bool);
}

contract GuessNumberGame {
    IERC20 public sttToken;
    address public owner;
    uint256 public stake = 2 * 10 ** 18; // 2 STT
    uint256 public reward = 5 * 10 ** 18; // 5 STT
    uint256 public pot;

    event GameResult(address indexed player, uint8 guess, uint8 answer, bool success);

    constructor(address _sttToken) {
        sttToken = IERC20(_sttToken);
        owner = msg.sender;
    }

    function play(uint8 guess) external {
        require(guess >= 1 && guess <= 10, "Guess must be 1-10");
        require(sttToken.transferFrom(msg.sender, address(this), stake), "STT transfer failed");

        pot += stake;

        uint8 answer = uint8((uint256(keccak256(abi.encodePacked(block.timestamp, msg.sender, block.prevrandao))) % 10) + 1);
        bool success = (guess == answer);

        if (success) {
            require(pot >= reward, "Not enough in pot");
            sttToken.transfer(msg.sender, reward);
            pot -= reward;
        }

        emit GameResult(msg.sender, guess, answer, success);
    }

    function getPotBalance() external view returns (uint256) {
        return pot;
    }

    function withdrawPot() external {
        require(msg.sender == owner, "Only owner");
        uint256 amount = pot;
        pot = 0;
        sttToken.transfer(owner, amount);
    }
}

